# 五笔重码的重灾区，有个相同特点，那就是组成词语的两个字都是相同偏旁。
# 比如：qtqt 都是「犭」偏旁。
# 极点五笔为了减少重码，是做了一些优化设计的，下面细说。
# 
#（1）qtqt -- 双 “犭” 的两字词语，把 q 直接当成 “犭”
# 比如：狼狈、狡猾、狐狸、猖獗，把 q 直接当成 “犭”
#「狼狈」的五笔是 qtqt -- 极点五笔还给出了 qyqm
#「狡猾」的五笔是 qtqt -- 极点五笔还给出了 quqm
#「狐狸」的五笔是 qtqt -- 极点五笔还给出了 qrqj
#「猖獗」的五笔是 qtqt -- 极点五笔还给出了 qjqd
#「猖狂」，极点五笔只给出了 qjqg -- 我补充了常规编码
#「狩猎」，极点五笔只给出了 qpqa -- 我补充了常规编码
#「猕猴」，极点五笔只给出了 qxqw -- 我补充了常规编码
# 参照此规则，我完善了：猢狲、狼狗、猛犸、猩猩，等等。
# 新世纪五笔，q 的字根明确的包括了 “犭”
